// Home.js
import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Home.css'; 

const Home = () => {
  const navigate = useNavigate();

  const handleJoinNow = () => {
    navigate('/signup'); // Redirect to Signup or any other page
  };

  return (
    <div className="home">
      <h1>Picreco</h1>
      <p>Identify the images you appear in</p>
      <button onClick={handleJoinNow}>Join Now</button>
    </div>
  );
};

export default Home;
